import React from 'react'

const MainPage  = ({ information }) => {
    if(information === null){
        return (
            <div className = "MainPage">
            </div>

        )
    }
    return (

        <div className = "MainPage">
            {information.data.data.map((match) => (
            
                    <div>
                            <h3 id="match">{match["score"]}</h3>
                            <h3>{match["date"]}</h3>
                    </div>
                      
                ) 
            
            )}
        </div>
    )

}


export default MainPage
